import React from "react";

import The_Team from "./Main/The_Team";
import Match_Centre from "./Main/Match_Centre";
import Tickets_Membership from "./Main/Tickets_Membership";
import News from "./Main/News";
import Merchandise from "./Main/Merchandise";
import Community from "./Main/Community"

export default function Main() {
    return (
      <div className="Main">
        <h3>Main</h3>
        <The_Team />
        <Match_Centre />
        <Tickets_Membership />
        <News />
        <Merchandise />
        <Community />

      </div>
    )
  }
